We also compared the performance of several direct solvers, which were called via the interfaces available in PETSc [6]: 
SuperLU and SuperLU Dist: sparse LU codes developed by Jim Demmel, Xiaoye S. Li, and John Gilbert [37] ( http://crd-legacy.lbl.gov/œxiaoye/SuperLU ); 
UMFPACK: part of the SuiteSparse package developed by Timothy Davis [28] ( http:// www.cise.ufl.edu/research/sparse/ ); 
MUMPS: MUltifrontal Massively Parallel sparse direct Solver, developed by Patrick Amestoy, Iain Du, Jacko Koster, and Jean-Yves LExcellent [1, 2] ( http://www.enseeiht.fr/ lima/apo/MUMPS/credits.html ); 
PaStiX: Parallel LU and Cholesky solvers [35] ( http://pastix.gforge.inria.fr/ ).
